import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import HomePage from './components/homepage';
import PostDetailed from './components/post';

function App() {
  return (
    <Router>
      <Switch>
        <Route path='/post/:post_id'>
          <PostDetailed />
        </Route>
        <Route path='/'>
          <HomePage />
        </Route>
      </Switch>
    </Router>
  )
}

export default App
